{
    "description": "Runs Calculix with specified parameters, allowing for output visualization and controlled termination. Supports both Windows and Linux environments.",
    "inputs": [
        {
            "name": "output_folder",
            "type": "string",
            "description": "Path to the output folder where results and logs will be stored. (Required)"
        },
        {
            "name": "name_inp",
            "type": "string",
            "description": "Name of the input file for Calculix. (Required)"
        },
        {
            "name": "OMP_NUM_THREADS",
            "type": "integer",
            "description": "Number of threads to use for parallel execution. Default is 8. (Optional)"
        },
        {
            "name": "outtxt",
            "type": "string",
            "description": "Name of the output log file. Default is 'out.txt'. (Optional)"
        },
        {
            "name": "mpi",
            "type": "boolean",
            "description": "Flag to enable MPI execution. Default is False. (Optional)"
        },
        {
            "name": "mpi_np",
            "type": "integer",
            "description": "Number of MPI processes to use if MPI is enabled. Default is 4. (Optional)"
        }
    ],
    "outputs": {
        "type": "tuple",
        "description": "Returns a tuple containing the error code (0 for success, 1 for failure) and the command used to run Calculix."
    },
    "examples": [
        {
            "input": {
                "output_folder": "/path/to/output",
                "name_inp": "example_input",
                "OMP_NUM_THREADS": 4,
                "outtxt": "output.log",
                "mpi": false,
                "mpi_np": 4
            },
            "output": "(0, 'ccx example_input > output.log')"
        },
        {
            "input": {
                "output_folder": "/path/to/output",
                "name_inp": "example_input",
                "mpi": true,
                "mpi_np": 8
            },
            "output": "(0, 'mpiexec -n 8 wine ccx_dynamic.exe example_input')"
        }
    ]
}

    {
  "name": "frd2json",
  "description": "Converts finite element data from an inp (djccx.inp.inp) and a results file (FRD) into a JSON-compatible dictionary structure.",
  "inputs": [
    {
      "name": "inpf",
      "type": "inp from djccx.inp.inp",
      "description": "The input file object, typically containing nodes, elements, and boundary conditions."
    },
    {
      "name": "elements",
      "type": "list",
      "optional": true,
      "description": "A list of surface elements to be included in the conversion. If not provided, all elements from 'inpf' will be used."
    },
    {
      "name": "frd",
      "type": "object",
      "optional": true,
      "description": "The results file object containing node displacements and additional results. If not provided, the default results stored in 'inpf.frd' are used."
    }
  ],
  "outputs": [{
    "type": "dict",
    "description": "A dictionary containing the processed data for further use or visualization.",
    "keys": [
      { "name": "x", "type": "list", "description": "Displaced x-coordinates of nodes." },
      { "name": "y", "type": "list", "description": "Displaced y-coordinates of nodes." },
      { "name": "z", "type": "list", "description": "Displaced z-coordinates of nodes." },
      { "name": "xi", "type": "list", "description": "Original x-coordinates of nodes." },
      { "name": "yi", "type": "list", "description": "Original y-coordinates of nodes." },
      { "name": "zi", "type": "list", "description": "Original z-coordinates of nodes." },
      { "name": "i", "type": "list", "description": "Node indices (i) defining faces of surface elements." },
      { "name": "j", "type": "list", "description": "Node indices (j) defining faces of surface elements." },
      { "name": "k", "type": "list", "description": "Node indices (k) defining faces of surface elements." },
      { "name": "magnitud", "type": "list", "description": "Displacement magnitudes for each node." },
      { "name": "i_list", "type": "list", "description": "List of node indices (i) for individual surfaces." },
      { "name": "j_list", "type": "list", "description": "List of node indices (j) for individual surfaces." },
      { "name": "k_list", "type": "list", "description": "List of node indices (k) for individual surfaces." },
      { "name": "names", "type": "list", "description": "Names of the surfaces." }
    ]
  }]
}

{
    "description": "Creates a skeleton (set of nodes) based on the closest nodes to the given trajectory.",
    "parameters": [
        {
            "name": "inp_files",
            "type": "object",
            "description": "The object containing the nodes and elements of the .inp file."
        },
        {
            "name": "element",
            "type": "object",
            "description": "The element object from which unique nodes are extracted."
        },
        {
            "name": "trajs",
            "type": "np.ndarray",
            "description": "An array of trajectory points. It is expected to be a 2D array with shape (n_points, 3) representing the trajectory in 3D space."
        },
        {
            "name": "radius",
            "type": "float",
            "default": 0.2,
            "description": "The radius used to filter nodes that are within a certain distance from the trajectory."
        },
        {
            "name": "name",
            "type": "str",
            "default": "skeleton",
            "description": "The name to assign to the node set (nset)."
        }
    ],
    "returns": {
        "type": "None",
        "description": "This function modifies the .inp file object by creating a new node set if nodes are found, or prints a warning if no nodes are close enough."
    },
    "example": {
        "description": "Example usage of CreateSkeletonFromTrajs function.",
        "code": "```python
# Assuming `inp_files` is a loaded .inp file object and `element` is an element object
trajs = np.array([[0, 0, 0], [1, 1, 1], [2, 2, 2]])  # Example trajectory in 3D space
radius = 0.3
CreateSkeletonFromTrajs(inp_files, element, trajs, radius, name="example_skeleton")
```"
    }
}

