{
    "description": "This function processes a string to create an ElsetCard or ElsetofElsetCard object. The string is formatted, cleaned, and converted into an integer array or a list depending on the case.",
    "inputs": [
        {
            "name": "content",
            "type": "list of strings",
            "description": "Content representing input data in comma-separated text format, possibly containing newline characters."
        },
        {
            "name": "name",
            "type": "string",
            "description": "Name of the card, which may include the prefix 'ELSET=' at the beginning."
        }
    ],
    "outputs": {
        "type": "ElsetCard or ElsetofElsetCard",
        "description": "Returns an ElsetCard object if the content can be converted into an integer array. Otherwise, returns an ElsetofElsetCard object."
    },
    "examples": [
        {
            "input": {
                "content": ["1, 2, 3,", "4, 5"],
                "name": "ELSET=ExampleSet"
            },
            "output": "ElsetCard('ExampleSet', array([1, 2, 3, 4, 5], dtype=int))"
        },
        {
            "input": {
                "content": ["a, b,", "c,"],
                "name": "ELSET=AnotherSet"
            },
            "output": "ElsetofElsetCard('AnotherSet', ['a', 'b', 'c'])"
        }
    ]
}

